
CREATE TABLE `patients` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `dob` varchar(255),
  `height` mediumint default NULL,
  `weight` mediumint default NULL,
  `current_med` TEXT default NULL,
  `allergies` TEXT default NULL,
  `medicare_num` varchar(21) default NULL,
  `parent_name` varchar(255) default NULL,
  `phone_no` varchar(100) default NULL,
  `email` varchar(255) default NULL,
  `address` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `requests` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `dob` varchar(255),
  `height` mediumint default NULL,
  `weight` mediumint default NULL,
  `current_med` TEXT default NULL,
  `allergies` TEXT default NULL,
  `medicare_num` varchar(21) default NULL,
  `parent_name` varchar(255) default NULL,
  `phone_no` varchar(100) default NULL,
  `email` varchar(255) default NULL,
  `address` varchar(255) default NULL,
  `password` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `volunteers` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


CREATE TABLE `researchers` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `specialisation` TEXT default NULL,
  `email` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;


CREATE TABLE `users` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `email` varchar(255) default NULL,
  `password` varchar(255),
  `type` TEXT default NULL,
  `volunteer_id` mediumint(8) default NULL,
  `patient_id` mediumint(8) default NULL,
  `researcher_id` mediumint(8) default NULL,
  `token` varchar(255) default NULL,

  PRIMARY KEY (`id`),
  FOREIGN KEY (volunteer_id) REFERENCES volunteers(id),
  FOREIGN KEY (patient_id) REFERENCES patients(id) ON DELETE CASCADE
) AUTO_INCREMENT=1;



CREATE TABLE `records` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `users_id` mediumint default NULL,
  `research_id` mediumint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (users_id) REFERENCES users(id) ON DELETE CASCADE,
  FOREIGN KEY (research_id) REFERENCES researchers(id)
) AUTO_INCREMENT=1;


CREATE TABLE `contents` (
  `id` mediumint(8)  NOT NULL auto_increment,
  `title` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  `phone` varchar(255) default NULL,
  `contactInfo` varchar(255) default NULL,
   PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

